import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import { Redirect } from 'react-router-dom';


export const Home = () => {
    return (
        <div className="home">
            <div className="menu">
                    <Link to="/Contact">
                        <button>Contact</button>
                    </Link>
                    <Link to="/login">
                        <button>Logout</button>
                    </Link>
                    <Link to="/profil">
                        <button>Profil</button>                    
                    </Link>
            </div>
            <div className="main">
                <h1>Welcome</h1>
            </div>
        </div>
    );
}
